import React, { useEffect, useState } from "react";
import axios from "axios";

const AdminDashboard = () => {
  const [complaints, setComplaints] = useState([]);
  const [filter, setFilter] = useState("All"); // ‚úÖ filter state

  useEffect(() => {
    fetchComplaints();
  }, []);

  const fetchComplaints = async () => {
    try {
      const res = await axios.get("http://localhost:5000/api/complaints");
      setComplaints(res.data.complaints || []);
    } catch (err) {
      console.error("Error fetching complaints:", err);
    }
  };

  // ‚úÖ Filtered list
  const filteredComplaints = complaints.filter((c) => {
    if (filter === "All") return true;
    if (filter === "General") return !c.category || c.category === "General";
    if (filter === "Women-Child") return c.category === "women-child";
    return true;
  });

  // ‚úÖ Location formatting
  const renderLocation = (c) => {
    if (c.latitude && c.longitude) {
      const url = `https://www.google.com/maps?q=${c.latitude},${c.longitude}`;
      return (
        <a href={url} target="_blank" rel="noopener noreferrer">
          {c.latitude}, {c.longitude} üìç
        </a>
      );
    } else if (c.location) {
      const url = `https://www.google.com/maps/search/?api=1&query=${encodeURIComponent(
        c.location
      )}`;
      return (
        <a href={url} target="_blank" rel="noopener noreferrer">
          {c.location} üìç
        </a>
      );
    }
    return "N/A";
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>üìã Admin Dashboard - Complaints</h2>

      {/* ‚úÖ Filter Buttons */}
      <div style={{ marginBottom: "15px" }}>
        <button onClick={() => setFilter("All")}>All</button>
        <button onClick={() => setFilter("General")}>General</button>
        <button onClick={() => setFilter("Women-Child")}>Women & Child</button>
      </div>

      <table border="1" cellPadding="10" cellSpacing="0" width="100%">
        <thead>
          <tr>
            <th>ID</th>
            <th>Token</th>
            <th>Name</th>
            <th>Description</th>
            <th>Department</th>
            <th>Category</th>
            <th>Location</th>   {/* ‚úÖ Google Maps link */}
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {filteredComplaints.length > 0 ? (
            filteredComplaints.map((c, i) => (
              <tr key={i}>
                <td>{c.id}</td>
                <td>{c.token}</td>
                <td>{c.name}</td>
                <td>{c.description}</td>
                <td>{c.department || "N/A"}</td>
                <td>{c.category || "General"}</td>
                <td>{renderLocation(c)}</td> {/* ‚úÖ Location clickable */}
                <td>{c.status}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="8" style={{ textAlign: "center" }}>
                No complaints found
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default AdminDashboard;
